INSERT INTO `courses_coursetranslation` VALUES (2,'ar','لغه عربيه','\"أهلاً بكم في رحلة تعلم اللغة العربية!\r\n\r\nانضم إلينا في مجموعة دروس اللغة العربية، حيث سنستكشف معًا جمال اللغة العربية ونتعلم كيفية التحدث والكتابة بها بثقة.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة لجميع المراحل العمرية.\r\nبرامج تعليمية مخصصة لتحقيق أهداف كل طالب.\r\nأنشطة وتطبيقات عملية لتعزيز المهارات اللغوية.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم اللغة العربية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',2),(3,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع خبراء نبئوني',3),(4,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع خبراء نبئوني',4),(5,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع نبئوني',5),(6,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع نبئوني',6),(7,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع منصه تبئوني',7),(8,'ar','اللغه الانجليزيه','حسن لغتك الانجليزيه مع منصه تبئوني',8),(9,'ar','اللغه العربيه','تعلم اللغه العربيه بسلاسه والقواعد النحويه و البلاغه و النطق الصحيح و تمتع مع خبراء منصه نبئوني',10),(10,'ar','رياضيات','\"أهلاً بكم في عالم الرياضيات\r\n\r\nالرياضيات ليست مجرد أرقام وحسابات، بل هي لغة الفهم والاستكشاف. إنها أداة قوية تساعدنا على فهم العالم من حولنا، من حركة الكواكب إلى سلوك الجزيئات.\r\n\r\nفي هذا الدرس، سنستكشف معًا مفاهيم رياضية مثيرة، وسنطبقها على تحديات حقيقية. سنستخدم المنطق والتفكير النقدي لتحليل المشكلات، ونجد حلولًا إبداعية.\r\n\r\nانضم إلينا في رحلة رياضية مثيرة، حيث سنكتشف معًا كيف يمكن للرياضيات أن تغير طريقة تفكيرنا وتعزز فهمنا للعالم.',11),(11,'ar','التربيه الاسلاميه','\"أهلاً بكم في رحلة تعلم التربية الإسلامية!\r\n\r\nانضم إلينا في مجموعات التربية الإسلامية، حيث سنستكشف معًا القيم والأخلاق الإسلامية وتعلم كيفية تطبيقها في حياتنا اليومية.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في العقيدة والأخلاق والشريعة الإسلامية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الإسلامي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم التربية الإسلامية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',12),(12,'ar','اللغه العربيه','\"أهلاً بكم في رحلة تعلم اللغة العربية!\r\n\r\nانضم إلينا في مجموعة دروس اللغة العربية، حيث سنستكشف معًا جمال اللغة العربية ونتعلم كيفية التحدث والكتابة بها بثقة.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة لجميع المراحل العمرية.\r\nبرامج تعليمية مخصصة لتحقيق أهداف كل طالب.\r\nأنشطة وتطبيقات عملية لتعزيز المهارات اللغوية.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم اللغة العربية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم  الينا الان',13),(14,'ar','رياضيات','\"أهلاً بكم في عالم الرياضيات!\r\n\r\nالرياضيات ليست مجرد أرقام وحسابات، بل هي لغة الفهم والاستكشاف. إنها أداة قوية تساعدنا على فهم العالم من حولنا، من حركة الكواكب إلى سلوك الجزيئات.\r\n\r\nفي هذا الدرس، سنستكشف معًا مفاهيم رياضية مثيرة، وسنطبقها على تحديات حقيقية. سنستخدم المنطق والتفكير النقدي لتحليل المشكلات، ونجد حلولًا إبداعية.\r\n\r\nانضم إلينا في رحلة رياضية مثيرة، حيث سنكتشف معًا كيف يمكن للرياضيات أن تغير طريقة تفكيرنا وتعزز فهمنا للعالم.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!\"',15),(15,'ar','رياضيات','\"أهلاً بكم في عالم الرياضيات!\r\n\r\nالرياضيات ليست مجرد أرقام وحسابات، بل هي لغة الفهم والاستكشاف. إنها أداة قوية تساعدنا على فهم العالم من حولنا، من حركة الكواكب إلى سلوك الجزيئات.\r\n\r\nفي هذا الدرس، سنستكشف معًا مفاهيم رياضية مثيرة، وسنطبقها على تحديات حقيقية. سنستخدم المنطق والتفكير النقدي لتحليل المشكلات، ونجد حلولًا إبداعية.\r\n\r\nانضم إلينا في رحلة رياضية مثيرة، حيث سنكتشف معًا كيف يمكن للرياضيات أن تغير طريقة تفكيرنا وتعزز فهمنا للعالم.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!\"',17),(16,'ar','التربيه الاسلاميه','\"أهلاً بكم في رحلة تعلم التربية الإسلامية!\r\n\r\nانضم إلينا في مجموعات التربية الإسلامية، حيث سنستكشف معًا القيم والأخلاق الإسلامية وتعلم كيفية تطبيقها في حياتنا اليومية.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في العقيدة والأخلاق والشريعة الإسلامية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الإسلامي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم التربية الإسلامية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',18),(17,'ar','لغه عربيه','\"أهلاً بكم في رحلة تعلم اللغة العربية!\r\n\r\nانضم إلينا في مجموعة دروس اللغة العربية، حيث سنستكشف معًا جمال اللغة العربية ونتعلم كيفية التحدث والكتابة بها بثقة.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة لجميع المراحل العمرية.\r\nبرامج تعليمية مخصصة لتحقيق أهداف كل طالب.\r\nأنشطة وتطبيقات عملية لتعزيز المهارات اللغوية.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم اللغة العربية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',19),(18,'ar','رياضيات','\"أهلاً بكم في عالم الرياضيات!\r\n\r\nالرياضيات ليست مجرد أرقام وحسابات، بل هي لغة الفهم والاستكشاف. إنها أداة قوية تساعدنا على فهم العالم من حولنا، من حركة الكواكب إلى سلوك الجزيئات.\r\n\r\nفي هذا الدرس، سنستكشف معًا مفاهيم رياضية مثيرة، وسنطبقها على تحديات حقيقية. سنستخدم المنطق والتفكير النقدي لتحليل المشكلات، ونجد حلولًا إبداعية.\r\n\r\nانضم إلينا في رحلة رياضية مثيرة، حيث سنكتشف معًا كيف يمكن للرياضيات أن تغير طريقة تفكيرنا وتعزز فهمنا للعالم.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!\"',20),(19,'ar','لغه عربيه','\"أهلاً بكم في رحلة تعلم اللغة العربية!\r\n\r\nانضم إلينا في مجموعة دروس اللغة العربية، حيث سنستكشف معًا جمال اللغة العربية ونتعلم كيفية التحدث والكتابة بها بثقة.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة لجميع المراحل العمرية.\r\nبرامج تعليمية مخصصة لتحقيق أهداف كل طالب.\r\nأنشطة وتطبيقات عملية لتعزيز المهارات اللغوية.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم اللغة العربية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الان',21),(20,'ar','التربيه الاسلاميه','\"أهلاً بكم في رحلة تعلم التربية الإسلامية!\r\n\r\nانضم إلينا في مجموعات التربية الإسلامية، حيث سنستكشف معًا القيم والأخلاق الإسلامية وتعلم كيفية تطبيقها في حياتنا اليومية.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في العقيدة والأخلاق والشريعة الإسلامية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الإسلامي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم التربية الإسلامية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',22),(21,'ar','دراسات اجتماعيه','\"أهلاً بكم في رحلة استكشاف الدراساتت الاجتماعية!\r\n\r\nانضم إلينا في مجموعة الدراسات الاجتماعية، حيث سنستكشف معًا العلاقات بين الأفراد والمجتمعات، ونفهم كيفية تشكيل الهويات والثقافات.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة حول المواضيع الاجتماعية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الاجتماعي.\r\nفرصة للتفاعل مع أعضاء المجموعة وتبادل الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف الدراسات الاجتماعية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',23),(22,'ar','علوم','\"أهلاً بكم في رحلة استكشاف العلوم!\r\n\r\nانضم إلينا في مجموعات العلوم، حيث سنستكشف معًا أسرار الكون والطبيعة. سنتعلم كيفية التفكير العلمي والبحث والاكتشاف.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في الفيزياء والكيمياء والأحياء.\r\nأنشطة وتجارب عملية لتعزيز الفهم العلمي.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\nفرصة للتعاون والتعلم مع زملاء من مختلف الأعمار.\r\n\r\nاحجز مكانك الآن، وكن جزءًا من رحلة استكشاف العلوم!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتجارب عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ احجز مكانك الآن!',24),(23,'ar','دراسات اجتماعيه','\"أهلاً بكم في رحلة استكشاف العلوم الاجتماعية!\r\n\r\nانضم إلينا في مجموعة الدراسات الاجتماعية، حيث سنستكشف معًا العلاقات بين الأفراد والمجتمعات، ونفهم كيفية تشكيل الهويات والثقافات.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة حول المواضيع الاجتماعية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الاجتماعي.\r\nفرصة للتفاعل مع أعضاء المجموعة وتبادل الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف العلوم الاجتماعية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',25),(24,'ar','دراسات اجتماعيه','\"أهلاً بكم في رحلة استكشاف العلوم الاجتماعية!\r\n\r\nانضم إلينا في مجموعة الدراسات الاجتماعية، حيث سنستكشف معًا العلاقات بين الأفراد والمجتمعات، ونفهم كيفية تشكيل الهويات والثقافات.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة حول المواضيع الاجتماعية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الاجتماعي.\r\nفرصة للتفاعل مع أعضاء المجموعة وتبادل الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف العلوم الاجتماعية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',26),(25,'ar','دراسات اجتماعيه','\"أهلاً بكم في رحلة استكشاف العلوم الاجتماعية!\r\n\