ا في مجموعات العلوم، حيث سنستكشف معًا أسرار الكون والطبيعة. سنتعلم كيفية التفكير العلمي والبحث والاكتشاف.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في الفيزياء والكيمياء والأحياء.\r\nأنشطة وتجارب عملية لتعزيز الفهم العلمي.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\nفرصة للتعاون والتعلم مع زملاء من مختلف الأعمار.\r\n\r\nاحجز مكانك الآن، وكن جزءًا من رحلة استكشاف العلوم!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتجارب عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ احجز مكانك الآن!',30),(29,'ar','رياضيات','\"أهلاً بكم في عالم الرياضيات!\r\n\r\nالرياضيات ليست مجرد أرقام وحسابات، بل هي لغة الفهم والاستكشاف. إنها أداة قوية تساعدنا على فهم العالم من حولنا، من حركة الكواكب إلى سلوك الجزيئات.\r\n\r\nفي هذا الدرس، سنستكشف معًا مفاهيم رياضية مثيرة، وسنطبقها على تحديات حقيقية. سنستخدم المنطق والتفكير النقدي لتحليل المشكلات، ونجد حلولًا إبداعية.\r\n\r\nانضم إلينا في رحلة رياضية مثيرة، حيث سنكتشف معًا كيف يمكن للرياضيات أن تغير طريقة تفكيرنا وتعزز فهمنا للعالم.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!\"',31),(30,'ar','التربيه الاسلاميه','\"أهلاً بكم في رحلة تعلم التربية الإسلامية!\r\n\r\nانضم إلينا في مجموعات التربية الإسلامية، حيث سنستكشف معًا القيم والأخلاق الإسلامية وتعلم كيفية تطبيقها في حياتنا اليومية.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في العقيدة والأخلاق والشريعة الإسلامية.\r\nأنشطة وتطبيقات عملية لتعزيز الفهم الإسلامي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة تعلم التربية الإسلامية!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتطبيقات عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',32),(31,'ar','التربيه الاسلاميه','\"أهلاً بكم في رحلة تعلم التربية الإسلامية!\r\n\r\nانضم إلينا في مجموعات التربية الإسلامية، حيث سنستكشف معًا القيم والأخلاق الإسلامية وتعلم كيفية تطبيقها في حياتنا اليومية.\r\n\r\nفي هذه المجموعة، سن