ة وتجارب عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',86),(75,'ar','فيزياء','\"أهلاً بكم في رحلة استكشاف الفيزياء!\r\n\r\nانضم إلينا في مجموعات الفيزياء، حيث سنستكشف معًا أسرار الكون والطاقة والحركة. سنتعلم كيفية تحليل الظواهر الفيزيائية وتحديد القوانين التي تحكمها.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في الميكانيكا والكهرومغناطيسية والفيزياء الحديثة.\r\nأنشطة وتجارب عملية لتعزيز الفهم الفيزيائي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف الفيزياء!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتجارب عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',87),(76,'ar','فيزياء','\"أهلاً بكم في رحلة استكشاف الفيزياء!\r\n\r\nانضم إلينا في مجموعات الفيزياء، حيث سنستكشف معًا أسرار الكون والطاقة والحركة. سنتعلم كيفية تحليل الظواهر الفيزيائية وتحديد القوانين التي تحكمها.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في الميكانيكا والكهرومغناطيسية والفيزياء الحديثة.\r\nأنشطة وتجارب عملية لتعزيز الفهم الفيزيائي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف الفيزياء!\r\n\r\nميزات المجموعة:\r\n\r\nمدرسين مؤهلين وذوي خبرة.\r\nدروس مخصصة لجميع المراحل العمرية.\r\nأنشطة وتجارب عملية.\r\nدعم وتشجيع من الأعضاء.\r\n\r\nماذا تنتظر؟ انضم إلينا الآن!',88),(77,'ar','فيزياء','\"أهلاً بكم في رحلة استكشاف الفيزياء!\r\n\r\nانضم إلينا في مجموعات الفيزياء، حيث سنستكشف معًا أسرار الكون والطاقة والحركة. سنتعلم كيفية تحليل الظواهر الفيزيائية وتحديد القوانين التي تحكمها.\r\n\r\nفي هذه المجموعة، سنقدم:\r\n\r\nدروس تفاعلية وممتعة في الميكانيكا والكهرومغناطيسية والفيزياء الحديثة.\r\nأنشطة وتجارب عملية لتعزيز الفهم الفيزيائي.\r\nفرصة للتفاعل مع أعضاء المجموعة ومشاركة الأفكار.\r\nدعم وتشجيع من المدرسين والمشاركين.\r\n\r\nانضم إلينا الآن، وكن جزءًا من رحلة استكشاف الفيزياء!\r\n\r\nميزات المج